import React, { Component } from "react";
import Header from "../../components/header/Header";
import Footer from "../../components/footer/Footer";
import Projects_newCard from "../../components/projects_newCard/Projects_newCard";
import Button from "../../components/button/Button";
import TopButton from "../../components/topButton/TopButton";
import { Fade } from "react-reveal";
import {
  greeting,
  projects_newHeader,
  projects_new,
} from "../../portfolio.js";
import "./Projects_new.css";
import BlogsImg from "./BlogsImg";

class Projects_new extends Component {
  render() {
    const theme = this.props.theme;
    return (
      <div className="Projects_new-main">
        <Header theme={theme} />
        <div className="basic-Projects_new">
          <Fade bottom duration={2000} distance="40px">
            <div className="Projects_new-heading-div">
              <div className="Projects_new-heading-img-div">
                {/* <img
											src={require(`../../assets/images/${Projects_newHeader["avatar_image_path"]}`)}
											alt=""
										/> */}
                <BlogsImg theme={theme} />
              </div>
              <div className="Projects_new-heading-text-div">
                <h1
                  className="Projects_new-heading-text"
                  style={{ color: theme.text }}
                >
                  {projects_newHeader.title}
                </h1>
                <p
                  className="projects_new-header-detail-text subTitle"
                  style={{ color: theme.secondaryText }}
                >
                  {projects_newHeader["description"]}
                </p>
              </div>
            </div>
          </Fade>
        </div>
        {/* Publications  */}

        <div className="repo-cards-div-main">
          {projects_new.data.map((pub) => {
            return <projects_newCard pub={pub} theme={theme} />;
          })}
        </div>

        <Footer theme={this.props.theme} onToggle={this.props.onToggle} />
        <TopButton theme={this.props.theme} />
      </div>
    );
  }
}

export default Projects_new;
